Page[28]=new Array("Med limbindaren kan du binda en utskrift så att den blir en pocketbok. Den viker ett omslag runt boken och limmar fast det. Du kan också beskära boken till önskat format.","Obs! ","Alternativet visas när en lämplig efterbehandlare har installerats på skrivaren. Det visas inte om omslag, häftning, hålning, bindning, falsning eller häftesframställning har valts.","Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Så här använder du Limbindaren:","Klicka på pilarna bredvid Efterbehandling i fönstret Papper/Utmatning och välj Limbindning.","Välj ett alternativ bredvid Bindningskant.","Stående - vänster: Stående orientering och bindning i vänstra kanten.","Stående - höger: Stående orientering och bindning i högra kanten.","Liggande - överkant: Liggande orientering och bindning i överkanten.","Liggande - underkant: Liggande orientering och bindning i underkanten.","Klicka på Beskärning och välj ett alternativ.","Ingen beskärning lämnar arken obeskurna.","Framkant eller Framsida: Beskär den kant som är motstående själva limningskanten.","Utfallande aktiverar Beskuret format, där du kan välja slutformatet. Med den här funktionen kan du låta sidbilden sträcka sig ända till kanten på papperet.","När du ska välja ett beskärningsformat, klicka på Beskuret format och välj format i en lista eller Eget.","Välj bland följande alternativ i listan Omslag för att välja papper för omslaget.","Namngivet papper: Här kan du välja ett namngivet papper från en lista eller skapa ett nytt Namngivet papper.","Annat format: Ställ in pappersformat eller skapa ett eget format.","Annan färg: Här kan du välja färger från en lista eller skapa en egen pappersfärg.","Annan typ: Här kan du välja papperstyp eller skapa egna papperstyper.","Annan vikt: Här kan du välja pappersvikten eller skapa en egen pappersvikt.","Avancerade pappersalternativ: Här väljer du avancerade pappersattribut för ditt omslag.","Klicka på OK.","Limbindare","perfect_binder.html");
Page[29]=new Array("Med Flera typer av efterbehandling kan du välja flera efterbehandlingsalternativ för samma jobb i ett och samma fönster.","Så här skriver du ut med flera typer av efterbehandling:","Klicka på pilarna bredvid Efterbehandling i fönstret Papper/Utmatning och välj Flera typer av efterbehandling.","Välj ett eller fler alternativ.","Häftning","Hålslagning","Falsning","Obs! ","Beroende på det alternativ du väljer först ändras placeringsalternativen för Häftning och Hålstans.","Z-fals halvt ark är inte tillgängligt för alla konfigurationer.","Klicka på OK.","Flera typer av efterbehandling","multiple_finishing.html");
Page[30]=new Array("DFA-efterbehandlarprofiler (Document Finishing Architecture) kopplar dig till en efterbehandlingsprofil som är inställd på skrivaren. När skapar ett eget namn för en efterbehandlare visas det i skrivardrivrutinen.","Så här anger du ett nytt namn:","Klicka på pilarna bredvid Efterbehandling i fönstret Papper/Utmatning och välj Anpassad.","Skriv namnet på DFA-efterbehandlaren i fältet Anpassad.","Klicka på OK.","DFA-efterbehandlarprofiler","custom_finishing.html");
Page[31]=new Array("Ett mellanlägg är ett tomt ark som automatiskt infogas mellan de sorterade eller buntade kopiorna i en utskrift.","Så här väljer du alternativ för mellanlägg:","Klicka på pilarna bredvid Efterbehandling i fönstret Papper/Utmatning och välj Mellanlägg.","Välj ett alternativ:","På eller Har aktiverats: Mellanlägg infogas.","Av eller Har inaktiverats: Stänger av Mellanlägg.","Klicka på OK.","Mellanlägg","slip_sheets.html");
Page[32]=new Array("Förskjut utmatning styr hur kopior förskjuts i utskrifter med flera exemplar. När alternativet har aktiverats förskjuts exemplaren något från varandra i utmatningsfacket. Alternativet är tillgängligt om utmatningsfacket har förskjutningsfunktion.","Så här använder du Förskjutning/Undersats:","Klicka på pilarna bredvid Efterbehandling i fönstret Papper/Utmatning och välj Förskjutning/Undersats.","Välj ett alternativ.","Skrivarens grundinställda typ: Aktuella skrivarinställningar används.","Inget: Utskriften sker utan förskjutning. Du kan fortfarande välja undersatser.","Varje sats: Varje sats förskjuts något i en utskrift med flera satser.","Med Varje undersats förskjuts ett angivet antal sidor i en sats.","Med Varje sats och varje undersats förskjuts ett angivet antal sidor i en sats och varje sats förskjuts i utskriftsjobb med flera satser.","Om du vill skriva ut undersatser i ett utskriftsjobb väljer du Aktivera undersatser.","I Sidor per undersats anger du det sidantal varje undersats ska innehålla. Varje undersats måste innehålla samma antal sidor.","Klicka på OK.","Förskjutning/Undersats","offset_subset.html");
Page[33]=new Array("Med Block kan du skapa block av enkelarksformulär, så att varje formulär kan rivas av. Det vanligaste är att ett block har ett bakre omslag i kartong och är limbundet i överkanten.","Så här skriver du ut block:","Klicka på pilarna bredvid Efterbehandling i fönstret Papper/Utmatning och välj Block.","Välj ett alternativ bredvid Block:","Har inaktiverats: Inaktiverar funktionen Skapa block.","Har aktiverats: Aktiverar blockutskrift.","Välj ett av följande alternativ i Antal block:","Ange antalet block som ska skrivas ut.","Om du vill använda skrivarens grundinställningar, välj Skrivarens grundinställda typ.","Välj ett av följande alternativ i Ark per block:","Ange antalet sidor för varje block.","Om du vill använda skrivarens grundinställningar, välj Skrivarens grundinställda typ.","Välj som Bakre omslag typen av bakre omslag för blocken.","Välj alternativ för Papper.","Namngivet papper: Här kan du välja ett namngivet papper från en lista eller skapa ett nytt Namngivet papper.","Annat format: Ställ in pappersformat eller skapa ett eget format.","Annan färg: Här kan du välja färger från en lista eller skapa en egen pappersfärg.","Annan typ: Här kan du välja papperstyp eller skapa egna papperstyper.","Annan vikt: Här kan du välja pappersvikten eller skapa en egen pappersvikt.","Avancerade pappersalternativ: Här väljer du avancerade pappersattribut för ditt omslag.","Klicka på OK.","Skapa block","pads.html");
Page[34]=new Array("Med funktionen Häften skrivs två dokumentsidor ut på varje sida av papperet. Sidorna placeras i ordning och vänds så att de hamnar i nummerordning när de falsas. Därefter kan sidorna häftas så att de bildar ett häfte. Kom ihåg att häfteslayouten skiljer sig från layouten på ett dokument där varje sida skrivs ut på ena sidan av papperet. Också rad- och sidbrytningar skiljer sig åt.","Obs! ","Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Med funktionen Häften kan du förminska bilden på sidan så att den kan skrivas ut på önskat pappersformat.","Så här skapar du ett häfte:","Klicka på pilarna bredvid Efterbehandling för häften i fönstret Häften och välj ett alternativ.","Ingen häftesefterbehandling eller falsning: Utskriften varken häftas eller falsas.","Häftesfals eller Vikning: Utskriften viks eller falsas längs mittlinjen.","Häftesfals och klammer eller Vikning och klammer: Utskriften viks eller falsas längs mittlinjen och två klamrar placeras i falsen så att sidorna hålls ihop.","Inaktivera Häften: Alternativ för häften tillämpas inte på utskriften. Använd detta alternativ om utskriftsjobbet redan är formaterat som ett häfte.","Om du vill att skrivaren ska skala en bild till ett nytt pappersformat klickar du på pilarna bredvid 	Skala till nytt pappersformat. Välj önskat pappersformat. Du anger ett anpassat pappersformat genom att klicka på Anpassat.","Ställ in marginaler genom att klicka på pilarna bredvid Häftesmarginaler och välja ett alternativ.","Standard förminskar sidbilden så att dokumentet skrivs ut som ett häfte på ett standardpappersformat utan bildförlust. Om skrivaren inte kan skriva ut till kanten på papperet ska du välja Standard.","Inget: Dokumentet skrivs ut som ett häfte utan förminskning av sidbilderna. Detta kan medföra att bilden blir avklippt om det inte går att skriva ut till kanten på papperet.","Obs! Exemplet visar två sidor med Letter-format som placerats på ett ark med Tabloid-format. I bilden till vänster används standardmarginaler. I bilden till höger används inga marginaler.","Ange fästmarginal och förskjutning efter behov.","Fästmarginal: Anger bredden (i punkter) på mittmarginalen mellan sidbilderna. Skriv punktvärdet eller ange det med hjälp av pilarna. En punkt är 0,35 mm eller 1/72 tum.","Förskjutning: Anger hur mycket sidbilderna ska förskjutas utåt (i tiondelar av en punkt). Skriv förskjutningsvärdet eller ange det med hjälp av pilarna.","Klicka på OK.","Häften","booklet_creation.html");
Page[35]=new Array("Så här väljer du utmatningsfack:","Klicka på pilarna bredvid Utmatningsfack i fönstret Papper/Utmatning och välj ett alternativ.","Du skickar utskriftsjobbet till ett utmatningsfack baserat på pappersformat och efterbehandlingsalternativ genom att välja Skrivarens grundinställda värde.","Obs! ","Beroende på övriga inställningar kan vissa magasin vara otillgängliga.","Listan visas inte om skrivaren är utrustad med ett enda utmatningsfack.","Utmatningsfack","output_destination.html");
Page[36]=new Array("Specialsidor är omslag, mellanlägg och undantagssidor som läggs till i en utskrift. Undantagssidor har andra inställningar än resten av utskriften.","Lägga till omslag","Lägga till mellanlägg","Lägga till undantag","Hantera specialsidor","Tidigare inställningar för specialsidor visas i översiktstabellen Specialsidor. I den här tabellen kan du välja en sida som du vill redigera eller ta bort. Du kan också ändra ordning på mellanlägg.","Så här redigerar, raderar eller flyttar du poster:","Välj ett av alternativen i listan över sparade sidor. Knapparna aktiveras.","Du väljer önskad åtgärd genom att klicka på knapparna.","Specialsidor","special_pages.html");
Page[37]=new Array("I fönstret Lägg till omslag kan du lägga till omslag i alla exemplar av dokumentet och ange egenskaper för omslagen. Rutan Jobbinställningar visar pappersinställningar för dokumentets huvuddel. Välj Använd jobbinställning om du vill använda jobbinställningen för en omslagsegenskap.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Så här lägger du till omslag:","Klicka på Lägg till omslag i fönstret Specialsidor.","Klicka på OK för att acceptera jobbets grundinställningar för alla inställningar.","Om du vill ange alternativ, välj ett alternativ för omslag i listan Omslagsalternativ.","Inga omslag avbryter tidigare inställningar för omslag.","Endast främre: Med detta alternativ skrivs den första sidan ut från angivet magasin. Med automatisk dubbelsidig utskrift skrivs de två första sidorna ut på omslaget.","Endast bakre: Med detta alternativ skrivs den sista sidan ut från angivet magasin. Med automatisk dubbelsidig utskrift skrivs de två sista sidorna ut på omslaget när antalet sidor är jämnt.","Främre och bakre: Samma: Med detta alternativ skrivs främre och bakre omslag ut från samma magasin.","Främre och bakre: Olika: Skriver ut främre och bakre omslag från olika magasin.","Du väljer format, färg eller typ av papper genom att klicka på pilarna bredvid Papper för främre respektive bakre omslag och välja önskade alternativ. ","Välj utskriftsalternativ för omslag.","Tomma eller förtryckta: Tomt eller förtryckt papper kan användas för omslaget.","Skriv ut på framsidan skriver ut på framsidan av omslaget.","Skriv ut på baksidan: Skriver ut på baksidan av omslaget.","Skriv ut på båda sidor: Skriver ut på båda sidor av omslaget.","Klicka på OK.","Lägg till omslag","add_covers.html");
Page[38]=new Array("Lägg till ett tomt eller förtryckt mellanlägg före den första sidan eller efter angivna sidor i dokumentet. Om du exempelvis vill infoga ett tomt färgat papper efter varje avsnitt i ett dokument ska du notera de sidnummer där avsnitten slutar. Ange sedan att det ska infogas mellanlägg efter varje angivet sidnummer.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Så här lägger du till ett mellanlägg:","Klicka på Lägg till mellanlägg i fönstret Specialsidor.","Välj typ av mellanlägg:","Före sida 1 infogar ett mellanlägg före sidan 1.","Efter sida/sidorna: Ett mellanlägg infogas efter sidan/sidorna du anger.","Om du väljer Efter sida/sidorna ska du ange det sidnummer som kommer före varje mellanlägg i fältet Sida/sidor.","Under Kvalitet anger du hur många mellanlägg som behövs.","Klicka på OK för att acceptera jobbets grundinställningar för alla inställningar.","Du väljer format, färg eller typ genom att klicka på pilarna bredvid Papper och välja önskade alternativ.","Klicka på OK.","Lägg till mellanlägg","add_inserts.html");
Page[39]=new Array("Välj Lägg till undantag när du vill ange undantagssidor i utskriften. Undantagssidor har andra inställningar än övriga sidor i jobbet. Du kan ange andra inställningar för pappersformat, papperstyp och pappersfärg. Du kan också ändra på vilken sida av papperet som utskriften ska ske. En utskrift kan innehålla flera undantag.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Undantag för utskriftspapper","Klicka på Lägg till undantag i fönstret Specialsidor.","Ange under Sida/sidor vilka sidor som undantaget. Avgränsa sidorna eller sidintervallen med kommatecken. Ange sidor i ett intervall med ett bindestreck. Om du exempelvis vill ange sidorna 1, 6, 9, 10 och 11 skriver du 1, 6, 9-11.","Klicka på OK för att acceptera jobbets grundinställningar för alla inställningar.","Du väljer format, färg, typ eller vikt genom att klicka på pilarna bredvid Papper och välja önskade alternativ.","Om du väljer Flikpapper som Papperstyp ska du ange antalet flikar under Ordningsnummer.","Om du väljer Papperstyp i följd, anger du papperstypens namn och ordningsnumret.","Välj ett alternativ under Dubbelsidig utskrift om du vill ändra på vilka sidor av papperet som utskriften ska ske:","Enkelsidig utskrift: Skriver ut undantagssidorna på en enda sida.","Dubbelsidig utskrift: Skriver ut undantagssidorna på båda sidorna av papperet och vänder arken längs långsidan. Utskriften kan bindas längs papperets långsida.","Dubbelsidig utskrift, vänd vid kortsida: Skriver ut undantagssidorna på båda sidorna av papperet och vänder arken längs kortsidan. Utskriften kan bindas längs papperets kortsida.","Välj ett alternativ för Utskriftsfärg.","Klicka på OK.","Undantag för bildalternativ","I fönstret Bildalternativ kan du ändra utseendet på utskrivna dokument.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Färg","Genomskinligt färgpulver eller Objektbaserat genomskinligt","Med Genomskinligt färgpulver kan utskriften fås att se ut som ett fotografi. Det kan också användas för att framhäva en viss bild, text eller grafik.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Så här använder du genomskinligt färgpulver:","Välj ett alternativ vid Alternativ för genomskinligt i fönstret Genomskinligt färgpulver.","Skrivarens grundinställda typ: Aktuella skrivarinställningar används.","Flöda genomskinligt: Hela sidan täcks med genomskinligt färgpulver.","Endast bilder: Endast sidobjekt som identifieras som bilder täcks med färgpulver.","Endast text: Bara själva texten täcks med genomskinligt färgpulver.","Endast grafik: Bara grafik täcks med genomskinligt färgpulver.","Inte bilder (endast text och grafik): Hela sidan &#8211; text och grafik &#8211; täcks med genomskinligt färgpulver men inga bilder.","Inte text (endast bilder och grafik): Hela sidan &#8211; bilder och grafik &#8211; täcks med genomskinligt färgpulver men ingen text.","Inte grafik (endast bilder och text): Hela sidan &#8211; bilder och text &#8211; täcks med genomskinligt färgpulver men ingen grafik.","Använd inte genomskinligt: Inget genomskinligt färgpulver används över huvud taget.","Använd inbäddat genomskinligt: Genomskinligt färgpulver tillämpas enligt instruktionerna i PDL (sidbeskrivningsspråket).","Den utskrivna sidan skapas enligt instruktionerna i PDL (sidbeskrivningsspråket). PDL inbegriper PostScript (PS) och Printer Command Language (PCL).","Ange mängden genomskinligt färgpulver genom att klicka på pilarna bredvid Mängd genomskinligt och välja ett alternativ.","Klicka på OK.","Anti-Aliasing","Med anti-aliasing jämnas taggiga kanter i bild och text ut.","Så här väljer du ett alternativ för Anti-aliasing:","Välj ett alternativ för Anti-aliasing i fönstret Bildalternativ.","Skrivarens grundinställda typ: Aktuella skrivarinställningar används.","På: Sätter på Anti-aliasing.","Av: Stänger av Anti-aliasing.","K100% hög upplösning: En skarp, fyllig svart färg används. Du kan använda denna funktion för tunn text eller för grafik som innehåller stora svarta fält.","Användarens tonåtergivningskurvor (TRC)","Tonåtergivningskurvor (TRC) ser till att varje färg i den utskrivna bilden är konstant. Med Användarens tonåtergivningskurvor kan du finjustera utskriftsfärgerna.","Så här skriver du ut med toneråtergivningskurvor:","Välj ett alternativ för Användarens toneråtergivningskurvor i fönstret Bildalternativ.","Skrivarens grundinställda typ: Aktuella skrivarinställningar används.","Välj ett namn i listan på de 10 senast angivna TRC-namnen.","Skriv ett nytt namn.","Upplösning","Upplösning anger kvaliteten på grafikbilder. Bildupplösningen mäts i punkter per tum (dpi). En inställning på 600 dpi återger bilder med 600 punkter (pixlar) per tum i bilden. En högre upplösning ger bättre utskriftskvalitet.","Du anger upplösning genom att klicka på Upplösning och välja ett alternativ eller Skrivarens grundinställda värde.","Rastrerad skärm","Rastrering är en utskriftsmetod som innebär att variationer i färg och ljusstyrka framställs genom bildpunkter (pixlar) i olika mörkhet, täthet och storlek. Detaljskärpan i den rastrerade bilden beror på antalet punkter per tum (dpi). Ju fler punkter per tum, desto större blir detaljskärpan i utskriften. Rastrering kallas ibland pixelering.","I stokastiskt raster används en process som bygger på slumpmässig fördelning av punkter, där man anger punkttätheten alltefter vilken nivå av grått man vill ha. Syftet är att undvika moarémönster. Den slumpmässiga faktorn gör att fotoåtergivning blir särskilt lyckad.","Välja alternativ för Rastrerad skärm:","Klicka på Rastrerad skärm i fönstret Bildalternativ och välj ett alternativ.","Skrivarens grundinställda typ: Aktuella skrivarinställningar används.","Välj ett värde. Ju fler punkter, linjer eller linjer per tum (Ipi) du väljer, desto mer detaljerad blir utskriften.","Välj Stokastiskt.","Spara färgpulver","Spara färgpulver minskar mängden färgpulver som används för utskriftsjobb och är bra att använda för utskrifter med utkastkvalitet. Utskriftens kvalitet blir lite lägre än med Standard.","Spara färgpulver aktiveras genom att klicka på pilarna bredvid Spara färgpulver i fönstret Bildalternativ och välja På","Bildläge","Med Bildläge kan du ändra placeringen av utskriftsbilden på sidan. Du kan flytta bilden längs X- och Y-axlarna på varje ark.","Så här väljer du alternativ för Bildläge:","Använd pilarna bredvid Alternativ för bildläge och välj ett alternativ.","Om du väljer Enkelsidig utskrift, välj ett alternativ för Alternativ för bildläge i fönstret Papper/Utmatning.","Skrivarens grundinställda typ: Aktuella skrivarinställningar används.","Oberoende: Inställningarna kan ändras manuellt.","Om du väljer Dubbelsidig utskrift, välj ett alternativ för Alternativ för bildläge i fönstret Papper/Utmatning.","Skrivarens grundinställda typ: Aktuella skrivarinställningar används.","Oberoende: Inställningarna kan ändras manuellt.","Spegelvänd X: Gör att du kan flytta bilder samma avstånd simultant på båda sidor men i motsatt riktning längs X-axeln.","Spegelvänd Y: Gör att du kan flytta bilder samma avstånd simultant på båda sidor men i motsatt riktning längs Y-axeln.","Spegelvänd båda: Gör att du kan flytta bilder samma avstånd simultant på båda sidor men i motsatt riktning längs X- och Y-axeln.","Spegelvänd X, Tandem Y: Gör att du kan flytta bilder samma avstånd simultant på båda sidor men i motsatt riktning längs X- och i samma riktning längs Y-axeln.","Spegelvänd Y, Tandem X: Gör att du kan flytta bilder samma avstånd simultant på båda sidor men i motsatt riktning längs Y- och i samma riktning längs X-axeln.","Tandem X: Gör att du kan flytta bilder samma avstånd simultant på båda sidor i samma riktning längs X-axeln.","Tandem Y: Gör att du kan flytta bilder samma avstånd simultant på båda sidor i samma riktning längs Y-axeln.","Tandem båda: Gör att du kan flytta bilder samma avstånd simultant på båda sidor i samma riktning längs X- och Y-axeln.","För Oberoende, gör följande:","För framsidan, ange hur mycket bilden ska förskjutas längs X- och Y-axeln.","Om baksidan är tillämplig, ange hur mycket bilden ska förskjutas längs X- och Y-axeln.","Obs! Alternativet för baksidan är tillgängligt bara om du väljer Dubbelsidig utskrift.","Klicka på OK.","Markeringsfärg","Med Markeringsfärg kan du se till att viktig text eller textpartier i utskriften framhävs.","Så här väljer du markeringsmetoder:","Klicka på Markeringsfärg i fönstret Bildalternativ.","Välj ett alternativ.","Skrivarens grundinställda typ: Aktuella skrivarinställningar används.","Mappningsalgoritm: Bestämmer hur alla färgerna skrivs ut, utom den färg som du väljer i Markera mappningsfärg. I de respektive valen används olika algoritmer för olika resultat.","Markera mappningsfärg: En viss färg väljs för markering.","Markera utskriftsfärg: Dokumentet skrivs ut med en färg som du väljer.","Policy för felinställning: Anger hur konflikt mellan den valda färgen och skrivarens färgmöjligheter ska hanteras.","Ljusare/mörkare","Lägg till undantag","add_exceptions.html");
